INSERT INTO `packages` VALUES (1,'Beginner Ski Packages','Designed to ease you into snow sports, our beginner range will make it easier for you to turn and have control, so you can gain confidence on the snow.','Skis or board, boots and poles.','Available for Downhill skiing, Snowboarding, Cross Country Classic skiing or Back Country Touring.'),(2,'Intermediate Ski Packages','Youâve got those turns happening and want to do some carving, well this is the gear for you.  Designed for the more aggressive skier/snowboarder.','Skis, boots & poles (Pilot binding for XC Skating).','Available for Downhill skiing, Snowboarding and Cross Country Skating.'),(3,'Performance Package','Designed for speed and ultimate control. These skis are for the experienced skier with a stiffer camber and boots to fit like a glove.','Skis, boots & poles (Garmon/Scarpa for Backcountry Touring).','Available for Downhill Skiiing and Back Country Touring Only.'),(4,'Clothing','No need to buy expensive snow clothing when you can be warm and dry with our range of ski hire clothing.','Aggression and Vigilante pants and Jackets and walking boots.','All equipment is cleaned after each use.'),(5,'Snow Play','You donât have to ski to enjoy the snow, we have toboggan hire for Falls Creek and snow shoes for hire.','Standard toboggan or Super Carve.','Make the most of your snow experience and be prepared.'),(6,'Snow Chains','Pick up your snow chain hire in Mount Beauty and we will show you how to fit them to YOUR car to ensure you are not left out in the cold.','Konig and V2 Diamond, easy fit chains.','All vehicles must carry snow chains when entering the alpine regions of Victoria.');
